import React from 'react'
import BigButton from '../BigButton'

function LoginInputComponent({handleChange, text, name, type, placeholder, classInput, classLabel, classDiv, classPass, classBtnPass, handleShowPass, textPassTn, passEye}) {
    return (
        <div class={classDiv}>
            <label class={classLabel}>{text}</label>
            <div class={passEye?classPass:classDiv}>
                <input  type={type} 
                        name={name}
                        placeholder={placeholder}
                        class={classInput} 
                        onChange={handleChange}
                    />
                {passEye && <BigButton onClickFunction={handleShowPass} text={textPassTn} cssClass={classBtnPass}/>}
            </div>
        </div>
    )
}

export default LoginInputComponent
